import { createStore } from "vuex";

export default createStore({
  state: {
    count: 1,
  },
  getters: {},
  mutations: {
    increment(state) {
      state.count++;
    },
    incrementBy(state, val) {
      state.count += val;
    },
  },
  actions: {},
  modules: {},
});
